import React from 'react'
import FeedItem from './feedItem'

let style = {
    overflow: 'scroll'
}

let feedArray = []

setTimeout(() => {
    feedArray.insert(<FeedItem>ABCDEF</FeedItem>)
}, 3000)


const unregisteredFeed = (feedArray) => {
    return(
    <div style={style}>
        {feedArray}
    </div>)
}

export default unregisteredFeed
